const DisplayAnt = ({ ants }) => {
    console.log(ants);

    const Ant = ({ ant }) => {
        return (
            <div>
                <div>Name: {ant.name}</div>
                <div>Length: {ant.length}</div>
                <div>Color: {ant.color}</div>
            </div>
        )
    }
    return (
        <div className="ant">
            {ants.ants.map((ant) => {
                return <Ant ant={ant} />
            })}
        </div>
    );
}

export default DisplayAnt;
